import React from 'react';
import { Col } from 'react-bootstrap';
import './day.css'

const day = (props) => {
    return ( 
        <Col  onClick={props.click} className='Day-css'>
            <div>
                <p>{props.num}</p>
            </div> 
        </Col>
    )
};

export default day;
